function setTextAnimation(n,t,i,r,u,f){let e=document.querySelectorAll("path"),o=f?"infinite":"forwards";for(let f=0;f<e.length;f++){const s=e[f],h=s.getTotalLength();s.style["stroke-dashoffset"]=`${h}px`;s.style["stroke-dasharray"]=`${h}px`;s.style["stroke-width"]=`${i}px`;s.style.stroke=`${u}`;s.style.animation=`${t}s svg-text-anim ${o} ${r}`;s.style["animation-delay"]=`${f*n}s`}}setTextAnimation(.1,2.7,4,"linear","#ffffff",!1);$(function(){$(".typer")[0]&&$(".typer").typed({strings:["Hi, my name is Jonathan","I am a Software Developer","I am also a business enthusiast","Best part, I am a hiking nut :-)","Let me know if I can be helpful","Have a great one!"],typeSpeed:50,loop:!0,loopCount:!1})});const{createApp}=Vue,form=createApp({methods:{async onSubmit(){Object.keys(this.errors).length>0&&(this.errors={});this.success!==null&&(this.success=null);const n=await $.post("/api/inquiry/newinquiry",this.form);n.success?(this.success="Thank you for your inquiry!",this.form={name:"",email:"",type:"",details:""}):(Object.keys(n.errors).includes("userError")?this.success=n.errors.userError:Object.keys(n.errors).includes("serverError")&&(this.success=n.errors.serverError),this.errors=n.errors)}},data(){return{form:{name:"",email:"",type:"",details:""},errors:{},success:null}}}).mount("#inquiry");